function utf16to8(str) { //
    var out, i, len, c;
    out = "";
    len = str.length;
    for (i = 0; i < len; i++) {
        c = str.charCodeAt(i);
        if ((c >= 0x0001) && (c <= 0x007F)) {
            out += str.charAt(i);
        } else if (c > 0x07FF) {
            out += String.fromCharCode(0xE0 | ((c >> 12) & 0x0F));
            out += String.fromCharCode(0x80 | ((c >> 6) & 0x3F));
            out += String.fromCharCode(0x80 | ((c >> 0) & 0x3F));
        } else {
            out += String.fromCharCode(0xC0 | ((c >> 6) & 0x1F));
            out += String.fromCharCode(0x80 | ((c >> 0) & 0x3F));
        }
    }
    return out;
}
function createQrcode(cont,src,text){
	var options = {
        render: 'canvas',
        text: utf16to8(text),
        height: 220,
        width: 220,
        typeNumber: -1,			//
        correctLevel: QRErrorCorrectLevel.H,//
        background: "#ffffff",	//
        foreground: "#e94132",	//
        //logo
        //src: 'http://192.168.10.99/front/images/index-icon5.png'
    }
	if(src){
		options.src = src;
	}
	$(cont).qrcode(options);
}
